const unsigned int charWidth  = bitmap_font_width / 256;
const unsigned int charHeight = bitmap_font_height;


unsigned int getCharWidth( )  { return charWidth;  }
unsigned int getCharHeight( ) { return charHeight; }



void getCharacter( char c, unsigned char* dst, unsigned int x, unsigned int y, unsigned int dstW, unsigned int dstH )
{
   // Conver the character to an unsigned integer between 0 and 255
   unsigned int theChar = (unsigned int)c;

   // Get the offset from the left in the bitmap_font array
   unsigned int offset = theChar * charWidth;

   // For each scanline
   for( unsigned int i=0; i<charHeight; ++i )
   {
      // Check if outside of buffer
      if( (y-i)>=dstH || y<i )
         continue;

      // Get a pointer to the current scanline, with respect to the offset of
      // the current caracter.
      const unsigned char* src = bitmap_font + bitmap_font_width*i + offset;

      // Get the pointer to the scanline in the target buffer
      unsigned char* tempDst = dst + (y-i)*dstW + x;

      // Copy the scanline to the destination buffer
      for( unsigned int j=0; j<charWidth && (x+j)<dstW; ++j )
      {
         tempDst[ j ] = src[ j ]*255;
      }
   }
}

